// @mui icons
import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from "@mui/icons-material/Twitter";
import GitHubIcon from "@mui/icons-material/GitHub";
import YouTubeIcon from "@mui/icons-material/YouTube";
import MKTypography from "components/MKTypography";
import personality from "personality-config";

export default {
	brand: {
		name:
			personality.businessName !== ""
				? personality.businessName
				: personality.name,
		image: personality.images.logo ?? personality.images.casual,
		route: "/",
	},
	socials: [
		{
			icon: <FacebookIcon />,
			link: "https://www.facebook.com/CreativeTim/",
		},
		{
			icon: <TwitterIcon />,
			link: "https://twitter.com/creativetim",
		},
		{
			icon: <GitHubIcon />,
			link: "https://github.com/creativetimofficial",
		},
		{
			icon: <YouTubeIcon />,
			link: "https://www.youtube.com/channel/UCVyTG4sCw-rOvB9oHkzZD1w",
		},
	],
	menus: [
		{
			name: "company",
			items: [
				{ name: "about us", href: "https://www.creative-tim.com/presentation" },
				{
					name: "freebies",
					href: "https://www.creative-tim.com/templates/free",
				},
				{
					name: "premium tools",
					href: "https://www.creative-tim.com/templates/premium",
				},
				{ name: "blog", href: "https://www.creative-tim.com/blog" },
			],
		},
		{
			name: "resources",
			items: [
				{ name: "illustrations", href: "https://iradesign.io/" },
				{ name: "bits & snippets", href: "https://www.creative-tim.com/bits" },
				{
					name: "affiliate program",
					href: "https://www.creative-tim.com/affiliates/new",
				},
			],
		},
		{
			name: "help & support",
			items: [
				{ name: "contact us", href: "https://www.creative-tim.com/contact-us" },
				{
					name: "knowledge center",
					href: "https://www.creative-tim.com/knowledge-center",
				},
				{
					name: "custom development",
					href: "https://services.creative-tim.com/",
				},
				{
					name: "sponsorships",
					href: "https://www.creative-tim.com/sponsorships",
				},
			],
		},
		{
			name: "legal",
			items: [
				{
					name: "terms & conditions",
					href: "https://www.creative-tim.com/terms",
				},
				{
					name: "privacy policy",
					href: "https://www.creative-tim.com/privacy",
				},
				{
					name: "licenses (EULA)",
					href: "https://www.creative-tim.com/license",
				},
			],
		},
	],
	copyright: (
		<MKTypography variant="button" fontWeight="regular">
			All rights reserved. Copyright &copy; {new Date().getFullYear()}
			{personality.businessName ?? personality.name}.
		</MKTypography>
	),
};
